import React from 'react';
import Iframe from 'react-iframe';

const Project = () => {
    return (
        <div>
        <iframe src='https://charlielaver.github.io/netflix-in-react-deploy/' width='100%' height='100%'></iframe>
        <Iframe url="https://charlielaver.github.io/netflix-in-react-deploy/"
        width="100%"
        height="100%"
        frameBorder="0"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"/>
        </div>
    )
}

export default Project
